#!/usr/bin/env bash
###
# install-peon-sounds.sh
# Self-contained installer for Warcraft peon sound effects as Claude Code hooks.
# All 18 WAV files are embedded (base64) — no external downloads needed.
#
# Events:
#   SessionStart      → "Ready" / "What?" sounds (new session greeting)
#   UserPromptSubmit  → "Yes" / "Yes Attack" sounds (acknowledging work)
#   Stop              → "Ready" / "What?" / "Yes" sounds (task complete)
#   Notification      → "What?" sounds (permission prompts only)
#
# Prerequisites:
#   - macOS (uses afplay)
#   - jq
#
# Usage: bash install-peon-sounds.sh
###
set -euo pipefail

HOOKS_DIR="$HOME/.claude/hooks"
SOUNDS_DIR="$HOOKS_DIR/sounds/peon"
SETTINGS="$HOME/.claude/settings.json"
HOOK_SCRIPT="$HOOKS_DIR/peon-sound.sh"

# -- Preflight checks --
if ! command -v jq &>/dev/null; then
  echo "Error: jq is required. Install with: brew install jq" >&2
  exit 1
fi

if [[ "$(uname)" != "Darwin" ]]; then
  echo "Warning: This hook uses macOS 'afplay'. You may need to swap the player command on Linux." >&2
fi

# -- Create directories --
mkdir -p "$SOUNDS_DIR"
mkdir -p "$(dirname "$SETTINGS")"

echo "Extracting 18 peon sound files..."

# -- Embedded sound files --
base64 -d << 'B64EOF' > "$SOUNDS_DIR/PeonAngry1.wav"

B64EOF

base64 -d << 'B64EOF' > "$SOUNDS_DIR/PeonAngry2.wav"

B64EOF

base64 -d << 'B64EOF' > "$SOUNDS_DIR/PeonAngry3.wav"

B64EOF

base64 -d << 'B64EOF' > "$SOUNDS_DIR/PeonAngry4.wav"

B64EOF

base64 -d << 'B64EOF' > "$SOUNDS_DIR/PeonDeath.wav"

B64EOF

base64 -d << 'B64EOF' > "$SOUNDS_DIR/PeonReady1.wav"

B64EOF

base64 -d << 'B64EOF' > "$SOUNDS_DIR/PeonWarcry1.wav"

B64EOF

base64 -d << 'B64EOF' > "$SOUNDS_DIR/PeonWhat1.wav"

B64EOF

base64 -d << 'B64EOF' > "$SOUNDS_DIR/PeonWhat2.wav"

B64EOF

base64 -d << 'B64EOF' > "$SOUNDS_DIR/PeonWhat3.wav"

B64EOF

base64 -d << 'B64EOF' > "$SOUNDS_DIR/PeonWhat4.wav"

B64EOF

base64 -d << 'B64EOF' > "$SOUNDS_DIR/PeonYes1.wav"

B64EOF

base64 -d << 'B64EOF' > "$SOUNDS_DIR/PeonYes2.wav"

B64EOF

base64 -d << 'B64EOF' > "$SOUNDS_DIR/PeonYes3.wav"

B64EOF

base64 -d << 'B64EOF' > "$SOUNDS_DIR/PeonYes4.wav"

B64EOF

base64 -d << 'B64EOF' > "$SOUNDS_DIR/PeonYesAttack1.wav"

B64EOF

base64 -d << 'B64EOF' > "$SOUNDS_DIR/PeonYesAttack2.wav"

B64EOF

base64 -d << 'B64EOF' > "$SOUNDS_DIR/PeonYesAttack3.wav"

B64EOF

echo "Extracted all sound files to $SOUNDS_DIR"

# -- Write the hook script --
cat > "$HOOK_SCRIPT" << 'HOOKEOF'
#!/usr/bin/env bash
# peon-sound: play Warcraft peon sounds on Claude Code hook events
set -euo pipefail

SOUNDS_DIR="$HOME/.claude/hooks/sounds/peon"

# Read hook JSON from stdin
INPUT=$(cat)

EVENT=$(echo "$INPUT" | jq -r '.hook_event_name // ""' 2>/dev/null)

# Map events to sound categories (space-separated file lists)
case "$EVENT" in
  SessionStart)
    SOUNDS=(PeonReady1.wav PeonWhat1.wav PeonWhat3.wav)
    ;;
  UserPromptSubmit)
    SOUNDS=(PeonYes1.wav PeonYes2.wav PeonYes3.wav PeonYes4.wav PeonYesAttack1.wav PeonYesAttack2.wav PeonYesAttack3.wav)
    ;;
  Stop)
    SOUNDS=(PeonReady1.wav PeonWhat4.wav PeonYes1.wav PeonYes2.wav PeonYes3.wav PeonYesAttack1.wav PeonYesAttack3.wav)
    ;;
  Notification)
    # Check if it's a permission prompt
    IS_PERMISSION=$(echo "$INPUT" | jq -r '.notification_type // ""' 2>/dev/null)
    if [ "$IS_PERMISSION" = "permission_prompt" ] || echo "$INPUT" | jq -e 'tostring | test("permission"; "i")' >/dev/null 2>&1; then
      SOUNDS=(PeonWhat4.wav PeonWhat2.wav PeonWhat3.wav PeonWhat1.wav)
    else
      exit 0
    fi
    ;;
  *)
    exit 0
    ;;
esac

# Pick a random sound
COUNT=${#SOUNDS[@]}
INDEX=$((RANDOM % COUNT))
SOUND_FILE="$SOUNDS_DIR/${SOUNDS[$INDEX]}"

# Play it (macOS)
if [ -f "$SOUND_FILE" ]; then
  afplay "$SOUND_FILE" &
fi
HOOKEOF

chmod +x "$HOOK_SCRIPT"
echo "Wrote hook script: $HOOK_SCRIPT"

# -- Merge hook entries into settings.json --
if [ ! -f "$SETTINGS" ]; then
  echo '{}' > "$SETTINGS"
fi

HOOK_CMD="\$HOME/.claude/hooks/peon-sound.sh"
HOOK_ENTRY='{"type":"command","command":"'"$HOOK_CMD"'","timeout":5,"async":true}'

EVENTS=("SessionStart" "UserPromptSubmit" "Stop" "Notification")

for event in "${EVENTS[@]}"; do
  ALREADY=$(jq --arg evt "$event" --arg cmd "$HOOK_CMD" '
    (.hooks[$evt] // [])
    | map(.hooks // [])
    | flatten
    | any(.command == $cmd)
  ' "$SETTINGS")

  if [ "$ALREADY" = "true" ]; then
    echo "Hook already registered for $event — skipping"
    continue
  fi

  jq --arg evt "$event" --argjson entry "$HOOK_ENTRY" '
    .hooks //= {} |
    if (.hooks[$evt] | length) > 0 then
      .hooks[$evt][0].hooks += [$entry]
    else
      .hooks[$evt] = [{"matcher":"","hooks":[$entry]}]
    end
  ' "$SETTINGS" > "${SETTINGS}.tmp" && mv "${SETTINGS}.tmp" "$SETTINGS"

  echo "Registered hook for $event"
done

echo ""
echo "Done! Peon sounds are now hooked into Claude Code."
echo "  Session start  → \"Ready\" / \"What?\" greetings"
echo "  Prompt submit  → \"Yes\" / \"Yes Attack\" acknowledgements"
echo "  Task complete  → assorted peon chatter"
echo "  Permission ask → confused \"What?\" sounds"
